const Contact = () => (
  <div>
    <Head>
      <title>Contact</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
    </Head>

    <header className={styles.header}>
      <div id="navbar">
        <Navigation/>
      </div>
    </header>

    <main>



    </main>

    <div className={styles.divider}></div>
    <NavigationFooter/>

  </div>
)
export default Contact;
